import React from 'react';
import Layout from '../components/Layout';

const HomePage: React.FC = () => {
    return (
        <Layout>
            <div className='home-page'>
                    <h1>Welcome to the Home Page</h1>
                    <p>This is the home page of the app</p>
            </div>
        </Layout>
    );
};

export default HomePage;
